import { StatusBar } from 'expo-status-bar';
import { Text, View } from 'react-native';
import MapView, { Marker } from 'react-native-maps'

import { NativeWindStyleSheet } from "nativewind";

NativeWindStyleSheet.setOutput({
  default: "native",
});

export default function App() {
  return (
    <>
      <View className="flex-1 bg-white items-center justify-center">
        <MapView
          className="w-full h-[100%] top-0 absolute"
          initialRegion={{
            latitude: 41.2288403,
            longitude: 1.7253999,
            latitudeDelta: 0.0922,
            longitudeDelta: 0.0421,
          }}
        />
        <View className="absolute w-full justify-center flex top-12 content-center">
          <View className="w-10/12 bg-white rounded-full left-0   m-auto ">
            <Text className=" px-8  py-3 text-center self-center text-zinc-500" >Search bar goes here</Text>
          </View>
        </View >
        <View className="absolute w-full justify-center flex bottom-8 content-center">
          <View className="w-10/12 bg-white rounded-full left-0   m-auto ">
            <Text className=" px-8  py-3 text-center   self-center" >Hell yes!</Text>
          </View>
        </View >
        <StatusBar style="auto" />

      </View >


    </>



  );
}
